const styles = (theme) => ({
  icon: {
    color: theme.palette.neutral.dark,
  },
  iconName: {
    color: 'rgba(0, 0, 0, 0.35)',
    fontSize: theme.typography.pxToRem(11),
    fontStyle: 'italic',
  },
});

export default styles;
